import React, { Component } from 'react';
import "./navbar.css";
import { Navbar, NavDropdown, Nav, Image } from "react-bootstrap";
import Logo from "../../assets/index.jpeg";
import { TiThMenu } from "react-icons/ti";
import { AiOutlineClose } from "react-icons/ai"
class Navbarweb extends Component {
    state = {
        changeicon: false

    }
    changeiconfrom = () => {
        this.setState((prevstate) => {
            return { changeicon: !prevstate.changeicon };
        });
    }

    render() {
        let icon = <TiThMenu />;
        if (this.state.changeicon) {
            icon = <AiOutlineClose />;
        }
        else {
            icon = <TiThMenu />;
        }

        return (
            <React.Fragment>

                <nav className="navbar navbar-expand-sm ">
                    <div className="container">                    <a href="#" className="navbar-brand"><img className="adjustlogo" src={Logo} /></a>


                        <button onClick={() => this.changeiconfrom()} className="navbar-toggler" data-toggle="collapse" data-target="#navbaraid">
                            <span >
                                {icon}
                            </span>
                        </button>
                        <div className="collapse navbar-collapse" id="navbaraid">


                            <ul className=" navbar-nav">
                                <li className="nav-item"><a href="#" className="nav-link">Home</a></li>
                                <li className="nav-item"><a href="#" className="nav-link">Home</a></li>
                                <li className="nav-item"><a href="#" className="nav-link">Home</a></li>
                                <li className="nav-item"><a href="#" className="nav-link">Home</a></li>
                            </ul>


                        </div>
                    </div>
                </nav>

            </React.Fragment >
        );
    }


}
export default Navbarweb;
